export const _newNote = (text, date, project) => {
    return fetch("http://localhost:8000/new-note/", {
        method: "POST",
        headers: {
            Accept: "application/json",
            "Content-Type": "application/json"
        },
        body: JSON.stringify({ text, date, project })
    }).then(res => res.json());
};
